import React, { useState } from "react";

const Search=()=>{
  
  const [img,setImg]=new useState("");

  const inputEvent=(event)=>{
   const data=event.target.value;
   setImg(data);
  }

 return(
  <>
  <div className="searchBar">
       <input type='text' 
              placeholder="Search Any Image" 
              value={img}
              onChange={inputEvent}
        />
  </div>
  </>
 );

}
export default Search;
